import { useSelector, useDispatch } from "react-redux";
import { useState } from "react";
import {orderPokemon} from "../../redux/actions"
import style from "./Filter.module.css"

const Filter = () => {

    const allPokemons = useSelector((state) => state.allPokemons);
    const dispatch = useDispatch();
    const [aux, setAux] = useState(false);

    const handlerOrderPokemon = (event) => {
        dispatch(orderPokemon(event.target.value));
        setAux(true);
    };

    // const handlerFilter = (event) => {
    //     dispatch(filterCards(event.target.value));
    // };

    return (
        <div>
            <div className={style.Selector}>
            <select name="Filter by source" onChange={(e) => handleFilterBySource(e)}>
        <optgroup label="Created">
          <option key={0} value="" disabled selected>
            Select source
          </option>
          <option key={1} value="all">
            All
          </option>
          <option key={2} value="created">
            Database
          </option>
          <option key={3} value="api">
            Api
          </option>
        </optgroup>
      </select>
            </div>
        </div>
    )
}

export default Filter;
